import React from "react"
import NINE from "../nl_logo.png";
import {BrowserRouter,Route,Link} from "react-router-dom";


class Managerheader1 extends React.Component {
    render() {
        return (
            <BrowserRouter>
            <header>
                <div className="ui clearing segment">
                     <img src={NINE} alt="nineleaps"  className="ui right floated header"/>

                    <h2 className="ui left floated header">Log out</h2>
                </div>
            </header>







            </BrowserRouter>

        )
    }
}
export default Managerheader1
